import React from "react";
import ReactDOM from "react-dom";
// import "./index.css";
// import App from "./App";
// import { Add, Divide, Mod, Mul, Sub } from "./Clc";

ReactDOM.render(
  <>
    <div className="cards">
      <div className="card">
        <img
          src="https://upload.wikimedia.org/wikipedia/commons/3/38/Stranger_Things_logo.png"
          alt="thumbnail"
          className="card-img"
          style={react}
        />
        <div className="card_info">
          <span className="card-category">A Netflix Orignal Series</span>
          <h3 className="card-title"></h3>
          <a href="https://www.netflix.com/in/" target="_blank">
            <button>Watch now</button>
          </a>
        </div>
      </div>
    </div>
  </>,
  document.getElementById("root")
);
